import React from 'react';
import { ScatterChart, Scatter, XAxis, YAxis, ZAxis, Tooltip, ResponsiveContainer, ReferenceLine, Cell } from 'recharts';
import { BarChart3, TrendingUp, Users } from 'lucide-react';

const Dashboard = ({ data, onUserSelect }) => {
  // Sorting data by Impact Z-score for the Performance Rankings
  const leaderboard = [...data].sort((a, b) => b.imp_z - a.imp_z);

  const getColor = (node) => {
    if (node.imp_z > 0 && node.vis_z < 0) return '#10b981'; // High Impact, Low Visibility (Green)
    if (node.imp_z > 0 && node.vis_z > 0) return '#3b82f6'; // High Impact, High Visibility (Blue)
    return '#64748b'; // Standard Performance (Slate)
  };

  return (
    <div className="flex gap-6 h-full">
      {/* Performance Matrix Visualization */}
      <div className="flex-[3] bg-slate-900/50 backdrop-blur-md p-6 rounded-xl border border-white/10 shadow-2xl">
        <h2 className="text-xl font-semibold text-white mb-6 flex items-center gap-3">
          <BarChart3 className="text-blue-400" size={20} /> 
          Performance Impact Matrix
        </h2>
        <div className="h-[500px] w-full">
          <ResponsiveContainer>
            <ScatterChart margin={{ top: 20, right: 30, bottom: 20, left: 10 }}>
              <XAxis 
                type="number" 
                dataKey="vis_z" 
                name="Visibility" 
                stroke="#475569" 
                tick={{fill: '#94a3b8'}} 
                label={{ value: 'Visibility Score', position: 'bottom', fill: '#94a3b8', fontSize: 12 }} 
              />
              <YAxis 
                type="number" 
                dataKey="imp_z" 
                name="Impact" 
                stroke="#475569" 
                tick={{fill: '#94a3b8'}} 
                label={{ value: 'Impact Score', angle: -90, position: 'left', fill: '#94a3b8', fontSize: 12 }} 
              />
              <Tooltip 
                cursor={{ strokeDasharray: '3 3' }} 
                contentStyle={{ 
                  backgroundColor: '#1e293b', 
                  border: 'none', 
                  borderRadius: '8px', 
                  color: '#f8fafc',
                  fontSize: '12px'
                }} 
              />
              <ReferenceLine x={0} stroke="#334155" strokeDasharray="2 2" />
              <ReferenceLine y={0} stroke="#334155" strokeDasharray="2 2" />
              <Scatter data={data} onClick={(e) => onUserSelect(e.payload)}>
                {data.map((entry, index) => (
                  <Cell 
                    key={`cell-${index}`} 
                    fill={getColor(entry)} 
                    className="hover:scale-110 transition-transform duration-200 cursor-pointer" 
                  />
                ))}
              </Scatter>
            </ScatterChart>
          </ResponsiveContainer>
        </div>
      </div>

      {/* Performance Rankings */}
      <div className="flex-1 bg-slate-900/50 backdrop-blur-md p-6 rounded-xl border border-white/10 overflow-y-auto">
        <h2 className="text-xl font-semibold text-white mb-6 flex items-center gap-3">
          <TrendingUp className="text-emerald-400" size={20} /> 
          Performance Rankings
        </h2>
        <div className="space-y-3">
          {leaderboard.map((user, index) => (
            <div 
              key={user.name} 
              onClick={() => onUserSelect(user)}
              className="group flex items-center justify-between p-4 rounded-lg bg-slate-800/40 hover:bg-blue-600/10 border border-transparent hover:border-blue-500/30 transition-all cursor-pointer"
            >
              <div className="flex items-center gap-3">
                <span className={`text-sm font-semibold min-w-[24px] ${index < 3 ? 'text-emerald-400' : 'text-slate-400'}`}>
                  #{index + 1}
                </span>
                <div>
                  <div className="text-white font-medium text-sm">{user.name}</div>
                  <div className="text-xs text-slate-400">Impact Score: {user.imp_z.toFixed(2)}</div>
                </div>
              </div>
              {user.imp_z > 1 && (
                <div className="w-2 h-2 bg-emerald-400 rounded-full"></div>
              )}
            </div>
          ))}
        </div>
      </div>
    </div>
  );
};

export default Dashboard;
